    string = []
    for i in range(size):
        string.append(stdin[i])
    # Populate the list with the set of the subsets of the string
    # The function returns the minimum possible total cost
    def findSubsets(string):
        # Base condition
        if len(string) == 0:
            return 0
        # Recursion condition
        if len(string) == 1:
            return 1
        if len(string) == 2:
            return 2
        if len(string) == 3:
            return 3
        # Create a set of the subsets
        # The function returns the minimum possible total cost
        # if the set has size k
        # and we can create another subset
        # of size k and add it to the set.
        # Otherwise we can't create any further subsets of the
        # set and the set will have the size k.
        def setCost(k, size):
            if k == size:
                return findSubsets(string[1:])
            else:
                return findSubsets(string[1:]) + findSubsets(string[2:])
        return min(setCost(k, size) for k in range(3, size+1))

    if findSubsets(string) >= cost:
        return findSubsets(string)
    return -1

