    for time, i in times.items():
        for i1, i2 in i.items():
            if i2:
                times_dict[i1] = i2

    # print(times_dict)

    def dfs(time, station, step=0):
        # print(time, station, step)
        if station == n:
            return step

        time_list = times_dict[station]
        # print(time_list)
        for t in time_list:
            if step == 0 and t % time == 0:
                return -1

            t -= step
            if t < 0:
                continue

            # print(station, t)
            res = dfs(t, station+1, step=step)
            if res >= 0:
                return res
            step = (step + t) % time

        return -1

